/* VCD dumping functions */
MOD_mkProjectTop_bsim & mkProjectTop_bsim_backing(tSimStateHdl simHdl)
{
  static MOD_mkProjectTop_bsim *instance = NULL;
  if (instance == NULL)
  {
    vcd_set_backing_instance(simHdl, true);
    instance = new MOD_mkProjectTop_bsim(simHdl, "top", NULL);
    vcd_set_backing_instance(simHdl, false);
  }
  return *instance;
}
void MODEL_mkProjectTop_bsim::dump_VCD_defs()
{
  (mkProjectTop_bsim_instance->dump_VCD_defs)(vcd_depth(sim_hdl));
}
void MODEL_mkProjectTop_bsim::dump_VCD(tVCDDumpType dt)
{
  (mkProjectTop_bsim_instance->dump_VCD)(dt, vcd_depth(sim_hdl), mkProjectTop_bsim_backing(sim_hdl));
}
